// FormRegisterPessoalData.tsx
import { useForm } from "react-hook-form";
import FormModel from "../Form/FormModel/FormModel";
import InputModel from "../Input/Input";
import { Link } from "react-router-dom";

interface Field {
  type: string;
  placeholder: string;
  name: string;
  error?: string;
}

interface FormProps {
  buttonText: string;
}

const fields: Field[] = [
  { type: "email", placeholder: "Digite seu email", name: "email", error: "Insira uma valor válido para Email!" },
  { type: "tel", placeholder: "Celular", name: "tel", error: "Insira uma valor válido para Celular!" },
  { type: "text", placeholder: "Nome ou apelido", name: "text", error: "Insira um nome ou apelido válido!" }
];

const FormRegisterPessoalData: React.FC<FormProps> = ({ buttonText }) => {
  const { register, handleSubmit, formState: { errors } } = useForm();

  const submitForm = (data: any) => {
    window.location.href = '/RegisterAdress';
  };


  return (

    <>

      <FormModel onSubmit={handleSubmit(submitForm)} buttonText={buttonText}>

        {fields.map((field, index) => (
          <InputModel
            key={index}
            register={register}
            type={field.type}
            placeholder={field.placeholder}
            error={errors[field.name] && field.error}
          />

        ))}

        <div className="flex flex-wrap gap-2 items-center my-3">
          <input
            style={{ width: '1.5em', height: '1.5em' }}
            className="checkbox: h-3/4"
            type="checkbox"
            {...register("agree", { required: true })}
          />
          <label className="flex items-center flex-wrap text-gray-400 text-2xl">
            I agree with
            <a href="#" className="flex flex-wrap items-center mx-2 text-gray-800 hover:underline">
              terms of service & privacy
              <img className="w-7" src="/external-link.svg" alt="Image of a link ancor" />
            </a>
          </label>
        </div>

      </FormModel>

      <div className="my-3">
        <p className="text-gray-400 text-2xl">
          Already have an account? <Link className="text-gray-800 hover:underline" to={'/'}>Login here</Link>
        </p>
      </div>

    </>
    
  );
};

export default FormRegisterPessoalData;
